import React from "react";
import { useImages } from '../util/ImageContext';

const Home = () => {
    const { images, loading } = useImages();

    if (loading) {
        return <div>Loading images...</div>;
    }

    const pic1 = images[0];

    return (
        <div className="w-full h-full">
            <div className="flex w-full h-1/4">
                <div className="w-1/4 h-full">nav</div>
                <div className="flex w-3/4 h-full">picdiv1</div>
            </div>
            <div className="flex w-full h-3/4">
                <div className="w-1/4 h-full"><img src={pic1} alt="pic1"/></div>
                <div className="w-3/4 h-full">picdiv3</div>
            </div>
        </div>
    );
}

export default Home;
